ISLAMABAD, June 9 (APP): Members of the National Assembly (MNAs) Khalid Javed, Barjees Tahir and former MNA Chaudhry Asad ur Rehman called on Prime Minister Shehbaz Sharif here on Thursday.
The current political situation in the country as well as the matters relating totheir respective constituencies were discussed in the meeting.
